import React from 'react';
import { BiChevronRight, BiChevronLeft } from "react-icons/bi";


function Password({ showSubContent, setshowSubContentClick }) {

    return (
        <div>
            <h1 onClick={() => setshowSubContentClick(0)} >
                    <BiChevronLeft
                      className="me-2 d-inline-block d-sm-none"

                    />
                    Password
                  </h1>
            vvv {showSubContent}

        </div>
    )
}

export default Password
